# OEIS sequence: A292672

def a(n):
    m, s, N = 0, {1}, range(1, n+1)
    g = [[0 for j in range(n+2)] for i in range(n+2)]
    row, col = {i:set() for i in N}, {j:set() for j in N}
    for i in N:
        for j in N:
            rect = {g[i-1][j-1], g[i-1][j], g[i][j-1], g[i-1][j+1]}
            e = min(s - row[i] - col[j] - rect)
            g[i][j] = e
            row[i].add(e)
            col[j].add(e)
            if e > m:
                m = e
                s.add(m+1)
    return m
